import React from 'react'
import './moviePageContent.css';

function MoviePageContent() {
  const description = [
    'Title: ',
    'Year: ',
    'Rating: ',
    'Countries: ',
    'Genres: ',
    'Director: ',
    'Cast: '
  ];


  return (
    <div className='moviePageContent'>
      <div className="descInfo">
        <ul>
            {description.map((description, index) => (
              <li key={index} className={index % 2 === 0 ? 'darkRow' : 'lightRow'}>
                <p>{description}</p>
              </li>
            ))}
          </ul>
      </div>
      <div className="description">
        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eaque provident et vero sequi nobis velit explicabo exercitationem repellendus pariatur blanditiis maiores ab .</p>
      </div>
    </div>
  )
}

export default MoviePageContent
